import { Grid,Box,Paper } from '@mui/material'
import React from 'react'
import { Link } from 'react-router-dom'
import { useSelector, useDispatch } from 'react-redux'
import '../Details/UserList.css'
import { Actiontypes } from '../Reducer/action'



export const UserList = ({contacts}) => {
  // const contacts = useSelector((state) => state);
  const dispatch = useDispatch()

  const deleteAccount = (id) => {
    dispatch({ type: Actiontypes.DELETE_CONTACT, payload: id })
  }



  return (
    <Box>
    <Grid container justifyContent={'center'}>
    <Grid item xs={12} sm={8} md={6} sx={{ marginTop: 2 }}>
      <Paper
        sx={{ padding: '17px', height: '500px', marginLeft: '7px' }}
      >
      <Link to="/"> <button style={{ backgroundColor: '#CF4B28', color: 'white', border: '1px solid #CF4B28', borderRadius: '6px', padding: '5px' }}>Add user</button> </Link>
      <div className='table-items'>
        <table style={{marginTop:10}} >
          <thead>
            <tr style={{ backgroundColor: '#CF4B28', color: 'white'}}>
              <th>id</th>
              <th>Name</th>
              <th>Code</th>
              <th>Type</th>
              <th>Description</th>
              <th>Edit</th>
              <th>Delete</th>
            </tr>
          </thead>
          <tbody >


            {contacts.length > 0 ? (
              contacts.map((contact, id) => (
                <tr key={id}>
                  <td>{id + 1}</td>
                  <td>{contact.name}</td>
                  <td>{contact.code}</td>
                  <td>{contact.type}</td>
                  <td>{contact.description}</td>

                  <td>
                    <Link


                      to={`/edit/${contact.id}`}
                    >
                      <button style={{ backgroundColor: '#CF4B28', color: 'white', border: '1px solid #CF4B28', borderRadius: '6px', padding: '5px' }}>
                        Edit</button>
                    </Link></td>
                  <td><button
                    type="button"
                    style={{ backgroundColor: '#CF4B28', color: 'white', border: '1px solid #CF4B28', borderRadius: '6px', padding: '5px' }}
                    onClick={() => deleteAccount(contact.id)}

                  >
                    Delete
                  </button>
                  </td>
                </tr>
              ))
            ) : (
              <tr>
                <th>No contacts found</th>
              </tr>
            )}
          </tbody>

        </table>
      </div>

      </Paper>
        </Grid>
      </Grid>
  </Box>
  )
}

const mapStateToProps = (state) => ({
  contacts: state,
});
const mapDispatchToProps = (dispatch) => ({
  deleteContact: (id) => {
    dispatch({ type: "DELETE_CONTACT", payload: id });
  },
});

export default connect(mapStateToProps, mapDispatchToProps)(Home);
